'use strict';
let TerminalUrlBuilder = require('./TerminalUrlBuilder.js');
//@@DocBrief("The factory for creating terminal URLs")
class TerminalUrlFactory {
    createTerminalUrl(name, url, protocol, secure, params) {
        let builder;
        builder = new TerminalUrlBuilder();
        builder.setName(name);
        builder.setUrl(url);
        builder.setProtocol(protocol);
        builder.setSecure(secure);
        builder.setParams(params);
        return builder.build();
    }
}
module.exports = TerminalUrlFactory
